import React, { useState } from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faTrash, faEdit } from '@fortawesome/free-solid-svg-icons';

const AssetTable = ({ assets, onDeleteAsset, onEditAsset }) => {
  const [selectedAssetID, setSelectedAssetID] = useState(null);

  const handleRadioChange = (assetID) => {
    setSelectedAssetID(assetID);
  };

  return (
    <div className="relative p-4 w-full bg-white border border-gray-200 rounded-lg shadow-md">
      <table className="table-auto w-full border-collapse">
        <thead>
          <tr>
            <th>Select</th>
            <th>ID</th>
            <th>Date Created</th>
            <th>Asset Name</th>
            <th>Details</th>
            <th>Category</th>
            <th>Location</th>
            <th>Quantity</th>
            <th>Cost</th>
            <th>Borrow</th>
            <th>Edit</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {assets.map((asset) => (
            <tr
              key={asset.assetID}
              className={selectedAssetID === asset.assetID ? 'bg-gray-200' : ''}
            >
              <td>
                <input
                  type="radio"
                  name="asset-select"
                  checked={selectedAssetID === asset.assetID}
                  onChange={() => handleRadioChange(asset.assetID)}
                />
              </td>
              <td>{asset.assetID}</td>
              <td>{asset.createdDate}</td>
              <td>{asset.assetName}</td>
              <td>{asset.assetDetails}</td>
              <td>{asset.selectedCategory}</td>
              <td>{asset.selectedLocation}</td>
              <td>{asset.quantity}</td>
              <td>{`₱${asset.cost}`}</td>
              <td>
                <button
                  className={`px-2 py-1 rounded ${selectedAssetID === asset.assetID ? 'bg-blue-500 text-white' : 'bg-gray-200'}`}
                  onClick={() => handleRadioChange(asset.assetID)}
                >
                  Borrow
                </button>
              </td>
              <td>
                <button
                  className="text-blue-600 flex items-center space-x-1"
                  onClick={() => onEditAsset(asset)}
                >
                  <FontAwesomeIcon icon={faEdit} />
                  <span>Edit</span>
                </button>
              </td>
              <td>
                <button
                  className="text-red-600 flex items-center space-x-1"
                  onClick={() => onDeleteAsset(asset.assetID)}
                >
                  <FontAwesomeIcon icon={faTrash} />
                  <span>Delete</span>
                </button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default AssetTable;
